package com.misit.abpenergy.Main.Responseimport androidx.annotation.Keepimport com.google.gson.annotations.SerializedName@Keepdata class MessageInfoResponse(	@field:SerializedName("message_info")	val messageInfo: List<MessageInfoItem>? = null)@Keepdata class MessageInfoItem(	@field:SerializedName("pesan")	val pesan: String? = null,	@field:SerializedName("tgl")	val tgl: String? = null,	@field:SerializedName("judul")	val judul: String? = null,	@field:SerializedName("id_info")	val idInfo: Int? = null,	@field:SerializedName("status")	val status: Int? = null)